import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Jeans = () => {
  const [jeansData, setJeansData] = useState([]);

  useEffect(() => {
    const fetchJeansData = async () => {
      try {
        const response = await axios.get('/api/jeans'); // Assuming your backend API route is '/api/jeans'
        setJeansData(response.data);
      } catch (error) {
        console.error('Error fetching jeans data:', error);
      }
    };

    fetchJeansData();
  }, []);

  return (
    <div>
      <h2>Jeans</h2>
      <ul>
        {jeansData.map((jeansItem) => (
          <li key={jeansItem._id}>
            <img src={jeansItem.image} alt={jeansItem.name} />
            <p>{jeansItem.name}</p>
            <p>{jeansItem.price}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Jeans;
